import { Section, Card } from "../components/Section";
import { Title } from "../components/AnimatedHeading";

export default function Especialista() {
  return (
    <Section>
      <div className="container">
        <Title as='h2'>Quem é o especialista?</Title>
        <Card>
          <p>
            Assessor de investimentos sênior com atuação prática em mercado local e internacional.
            Portfólio com ênfase em títulos indexados ao IPCA+, crédito privado e REITs.
            Missão: ajudar quem já possui patrimônio a multiplicar com método, clareza e proteção.
          </p>
        </Card>
      </div>
    </Section>
  );
}
